import React from 'react';

class GeneralPractice18 extends React.Component{
  constructor(props){
    super(props);

    this.state = {image1: 'boxA.gif',
                  image2: 'boxB.gif'};
  }

  styles = {
    duoImage: {width: '220px',
               height: '200px'}
  }

  imageHandler = (e, key) => {
    console.log(key);
    e.target.src.includes('boxA.gif') ? this.setState({key: 'boxA.gif'}) : this.setState({key: 'boxB.gif'});
  }

  // displayHidden () => {
  //   ;
  // }

  render(){
    return (
        <div>
          <img key='image1' src={this.state.image1} onClick={this.imageHandler(this.key)} style={this.styles.duoImage}></img>
          <img key='image2' src={this.state.image2} onClick={this.imageHandler(this.key)} style={this.styles.duoImage}></img>
        </div>
      );
  }
}





export default GeneralPractice18;
